import { Switch, Route } from "react-router-dom";
import Home from "../Pages/Home/index"
import Catalogo from "./../Pages/Catalogo/index"
import Casamento from "../Pages/CasamentoPage/index"
const Routes = () => {
  return (
    <Switch>
      <Route exact path="/">
          <Home />
      </Route>
      <Route path = "/drinks">
        <Catalogo />        
      </Route>
      <Route>
        <Casamento />
      </Route>
    </Switch>
  );
};
export default Routes;
